import './Preloader.css';

const Preloader = () => {
  return (
    <div className="preloader-wrapper">
      <img
        src="https://i.gifer.com/74H8.gif"
        alt="Loading..."
        className="preloader-gif"
      />
    </div>
  );
};

export default Preloader;
